backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block = var.vpc_cidr
  enable_dns_hostnames = true
  tags = {
    Name = "${var.application_name}-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnet_cidrs)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnet_cidrs[count.index]
  availability_zone       = var.availability_zones[count.index]
  map_public_ip_on_launch = true

  tags = {
    Name = "${var.application_name}-subnet-public-${count.index}"
  }
}

resource "aws_internet_gateway" "main" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "${var.application_name}-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.main.id
  }

  tags = {
    Name = "${var.application_name}-rt-public"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(aws_subnet.public)
  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

./module/vpc/variables.tf.code:
variable "aws_region" {
  description = "AWS region to deploy the infrastructure"
  type        = string
  default     = "us-west-2"
}

variable "application_name" {
  description = "Name of the application for tagging"
  type        = string
  default     = "cloud_ai_app"
}

variable "vpc_cidr" {
  description = "CIDR block for the VPC"
  type        = string
  default     = "10.0.0.0/16"
}

variable "public_subnet_cidrs" {
  description = "List of public subnet CIDR blocks"
  type        = list(string)
  default     = ["10.0.1.0/24", "10.0.2.0/24"]
}

variable "availability_zones" {
  description = "List of availability zones in the region"
  type        = list(string)
  default     = ["us-west-2a", "us-west-2b"]
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  value       = aws_vpc.main.id
  description = "ID of the VPC created"
}

output "public_subnet_ids" {
  value       = aws_subnet.public[*].id
  description = "List of public subnet IDs"
}

./module/ec2/main.tf.code:
resource "aws_security_group" "main" {
  name        = "${var.application_name}-sg"
  description = "Security group for ${var.application_name}"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_launch_configuration" "main" {
  name_prefix     = "${var.application_name}-lc"
  image_id        = var.ami_id
  instance_type   = var.instance_type
  security_groups = [aws_security_group.main.id]

  user_data = <<-EOF
              #!/bin/bash
              echo "Welcome to nginx" > /usr/share/nginx/html/index.html
              echo "Auto Deployment from Cloud-AI" >> /usr/share/nginx/html/index.html
              service nginx start
              EOF

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "main" {
  name_prefix           = "${var.application_name}-asg"
  launch_configuration  = aws_launch_configuration.main.id
  vpc_zone_identifier   = var.subnets
  min_size              = var.asg_min_size
  max_size              = var.asg_max_size

  tag {
    key                 = "Name"
    value               = "${var.application_name}-instance"
    propagate_at_launch = true
  }
}

resource "aws_alb" "main" {
  name               = "${var.application_name}-alb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.main.id]
  subnets            = var.subnets

  enable_deletion_protection = false

  tags = {
    Name = "${var.application_name}-alb"
  }
}

resource "aws_alb_target_group" "main" {
  name     = "${var.application_name}-tg"
  port     = 80
  protocol = "HTTP"
  vpc_id   = var.vpc_id
}

resource "aws_alb_listener" "main" {
  load_balancer_arn = aws_alb.main.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.main.arn
  }
}

resource "aws_autoscaling_attachment" "asg_attachment" {
  autoscaling_group_name = aws_autoscaling_group.main.id
  alb_target_group_arn   = aws_alb_target_group.main.arn
}

